import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { ItemListComponent } from './components/item-list/item-list.component';



@NgModule({
  declarations: [
    ItemListComponent
  ],
  imports: [
    CommonModule
  ]
})
export class ShoppingModule { }
